import React, {useEffect, useState} from 'react'
import { useLocation, Link } from 'react-router-dom';
import productSale from "../img/product-sale.png"

const Categories = () => {
    const [product, setProduct] = useState(null);
    const location = useLocation();
    const isKhmer = location.pathname.startsWith('/kh');
    const currentLanguage = location.pathname.split('/')[1] || 'en';

    useEffect(() => {
        const fetchProduct = async () => {
            try {
                const response = await fetch('https://fakestoreapi.com/products/1'); // Fetch the product
                if (!response.ok) {
                    throw new Error('Failed to fetch product');
                }
                const data = await response.json();
                setProduct(data);
            } catch (e) {console.log(e);}
        };

        fetchProduct();
    }, []);
  return (
    <div>
          {/* <!-- Categories Section Begin --> */}
          <section class="categories spad">
              <div class="container">
                  <div class="row">
                      <div class="col-lg-3">
                          <div class="categories__text">
                              <h2>{isKhmer ? 'សម្លៀកបំពាក់រដូវក្ដៅ' : 'Clothings Hot'} <br /> <span>{isKhmer ? 'កាបូប' : 'Bag Collection'}</span> <br />{isKhmer ? 'គ្រឿងបន្ថែម' : 'Accessories'} </h2>
                          </div>
                      </div>
                      <div class="col-lg-4">
                          <div class="categories__hot__deal">
                              <img src={productSale} alt="" />
                              <div class="hot__deal__sticker">
                                  <span>{isKhmer ? 'តម្លៃសល់ត្រឹម' : 'Sale Of'}</span>
                                  <h5>$29.99</h5>
                              </div>
                          </div>
                      </div>
                      <div class="col-lg-4 offset-lg-1">
                          <div class="categories__deal__countdown">
                              <span>{isKhmer ? 'តម្លៃប្រចាំសប្ដាហ៍' : 'Deal Of The Week'}</span>
                              <h2>Multi-pocket Chest Bag Black</h2>
                              <div class="categories__deal__countdown__timer" id="countdown">
                                  <div class="cd-item">
                                      <span>{isKhmer ? '៣' : '3'}</span>
                                      <p>{isKhmer ? 'ថ្ងៃ' : 'Days'}</p>
                                  </div>
                                  <div class="cd-item">
                                      <span>{isKhmer ? '១' : '1'}</span>
                                      <p>{isKhmer ? 'ម៉ោង' : 'Hours'}</p>
                                  </div>
                                  <div class="cd-item">
                                      <span>{isKhmer ? '៥០' : '50'}</span>
                                      <p>{isKhmer ? 'នាទី' : 'Minutes'}</p>
                                  </div>
                                  <div class="cd-item">
                                      <span>{isKhmer ? '១៨' : '18'}</span>
                                      <p>{isKhmer ? 'វិនាទី' : 'Seconds'}</p>
                                  </div>
                              </div>
                              <Link to={`/${currentLanguage}/shop`} class="primary-btn">{isKhmer ? 'ទិញឥឡូវនេះ' : 'Shop now'}</Link>
                          </div>
                      </div>
                  </div>
              </div>
          </section>
          {/* <!-- Categories Section End --> */}
    </div>
  )
}

export default Categories
